# Definition for singly-linked list.
class ListNode(object):
    def __init__(self, val=0, next=None):
        self.val = val
        self.next = next


class Solution(object):
    def sortList1(self, head):  # 插入排序
        """
        :type head: ListNode
        :rtype: ListNode
        """
        if not head:
            return None
        temp_head = ListNode(-100001, head)
        cur = head.next
        head.next = None
        while cur:
            next_node = cur.next
            pre_node = temp_head
            while pre_node.next and cur.val > pre_node.next.val:
                pre_node=pre_node.next
            cur.next = pre_node.next
            pre_node.next=cur
            cur = next_node
        return temp_head.next

    def sortList(self, head):  # 插入排序
        """
        :type head: ListNode
        :rtype: ListNode
        """
        if not head:
            return None
        node_list = []
        cur = head
        while cur:
            node_list.append(cur)
            cur = cur.next
        node_list.sort(key=lambda x:x.val)
        return node_list[0]


